const styles = (theme) => ({
    rootTree: {
        marginRight: 0,
        fontSize: theme.typography.pxToRem(11),
    },
    dmsBoxWidth: { maxWidth: '85%' },
    labelCol: {
        fontWeight: 'inherit',
        overflow: 'hidden',
        '& > span': {
            display: 'block!important',
        },
    },
    lebelInfoCol: {
        overflow: 'hidden',
    },
    inputPropsRoot: {
        fontSize: theme.typography.pxToRem(12),

        '& > input': {
            paddingTop: '5.5px !important',
            paddingBottom: '5.5px !important',
        },
    },
    fileLabel: {
        display: 'block',
        width: '95%',
        whiteSpace: 'nowrap',
        overflow: 'hidden',
        textOverflow: 'ellipsis',
    },
    gxbLabel: {
        display: 'block',
        width: '95%',
        whiteSpace: 'nowrap',
        overflow: 'hidden',
        textOverflow: 'ellipsis',
        '&:before': {
            content: `'GXB'`,
            position: 'absolute',
            left: '-30px',
            marginTop: theme.typography.pxToRem(2),
            fontSize: theme.typography.pxToRem(10),
            fontWeight: theme.typography.fontWeightMedium,

        }
    }
});

export default styles;
